import React, { useState, useEffect } from "react";
export default function UpdateCarModal() {
  const [modal, setModal] = useState(false);
  const toogleModal = () => {
    setModal(!modal)
  }

  return <>
  <button className="btn-modal" onClick={toogleModal}
  >Open</button>
  <div className="modal">
    <div className="overlay">
      <h2>Spremeni avto</h2>
      <p>Test</p>
    </div>
  </div>
  </>;
}
